import Content from '@/components/EquityContent.vue';
import { mapState } from 'vuex';
export default {
	data() {
		return {
			isLoading: false,
			active: 0
		};
	},
	computed: {
		...mapState(['equityList'])
	},
	created() {
		// this.getVipHelp();
		this.isLoading = true;
	},
	activated: function() {
		this.active = this.$route.query.id;
	},
	methods: {
		ToText(HTML) {
			var input = HTML;
			return input
				.replace(/<(style|script|iframe)[^>]*?>[\s\S]+?<\/\1\s*>/gi, '')
				.replace(/<[^>]+?>/g, '')
				.replace(/\s+/g, ' ')
				.replace(/ /g, ' ')
				.replace(/>/g, ' ');
		}
	},
	components: {
		'v-content': Content
	}
};
